import React from "react"



export default function Sidebar(props) {

    const noteElements = props.notes
    console.log(noteElements)

    return (
        <>
            <section className="pane sidebar">
                <div className="sidebar--header">
                    <h3>Notes</h3>
                    <h2>this is the sidebar </h2>
                    {noteElements}
                </div>
            </section>

        </>

    )
}
